import React from 'react';

function TabNav({ activeTab, setActiveTab }) {
  const tabs = [
    { id: 'timeline', label: 'Timeline', icon: '‚â°' },
    { id: 'timer', label: 'Timer', icon: '‚è±Ô∏è' },
    { id: 'garden', label: 'Garden', icon: 'üå±' },
    { id: 'blacklist', label: 'Blacklist', icon: '‚õî' },
    { id: 'usage', label: 'Usage', icon: 'üìä' },
  ];

  return (
    <div className="w-full bg-tomato rounded-b-xl p-3 flex justify-between">
      {tabs.map((tab) => (
        <button
          key={tab.id}
          onClick={() => setActiveTab(tab.id)}
          className={`flex flex-col items-center text-white ${
            activeTab === tab.id ? 'opacity-100' : 'opacity-70'
          }`}
        >
          <span className="text-xl">{tab.icon}</span>
          <span className="text-xs mt-1">{tab.label}</span>
        </button>
      ))}
    </div>
  );
}

export default TabNav;
